ront of the television cameras.  \n Jabber is already in the field. The shots of the rifles remind him that he lives in the buffer zone  \n that separates Gaza from Israel.\n A manifestation is going on in the streets.  Moemen is there, doing his job as photographer. \n At the port a boat returns with the hull riddled by shots.\n The chant of the muezzin invades the space , multiplied by the minarets. \n As in a dream , the boys of the Parkour Team pirouette in a cemetery.\n Life in the strip winds up until night.\n\nDIRECTOR' S NOTE\n\nThe film is a choral fresco of Gaza.\nIn the narrative arc of a day, the stories of the characters blend in with the description of the context.\nMen and women who resist , capable of tenderness and smiles, determined not to succumb to conditions of life that appear impossible .\nThe film is the result of a collective project and was realized by Italian and Palestinian videomakers, sharing ideas, stories, opinions and technical skills.\nNot a film about Gaza, but with Gaza.\n\nDirectors: Valeria Testagrossa, Nicola Grignani, Andrea Zambelli, Alberto Mussolini, Luca Scaffidi\n\nSelected in competition at Torino Film Festival"},"lengthSeconds":"152","ownerProfileUrl":"http://www.youtube.com/@ValeriaTestagrossa","externalChannelId":"UCAQRxqZmbJ3eoqzMhlJAY0w","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK"
